function MyInfo(){
	return (
		<div>
			<h1>Yaoguang Zhu</h1>
			<p>My name is Yaoguang Zhu!</p>
			<ol>
				<li>Changlong Park</li>
			</ol>
		</div>
	);
}

ReactDOM.render(
	<MyInfo />,
  document.getElementById('root')
);

